				endPos = buffered + mem.write(data, buffered, encoding);
			}
		} else {
			endPos = buffered + mem.write(data, buffered, encoding);
		}
		if (endPos < 32) {
			this.buffered = endPos;
		} else {
			const l = (endPos >> 5) << 5;
			exports.update(l);
			const newBuffered = endPos - l;
			this.buffered = newBuffered;
